You can setup configs/hyper-parameters with functions. Lab would identify the dependencies and run them in topological order. @Configs.calc()
def model(c: Configs): return Net().to(c.device) You can setup multiple options for configuration functions. So you don't have to write a bunch if statements to handle configs. @Configs.calc(Configs.optimizer)
def sgd(c: Configs): return optim.SGD(c.model.parameters(), lr=c.learning_rate, momentum=c.momentum) @Configs.calc(Configs.optimizer)
def adam(c: Configs): return optim.Adam(c.model.parameters())
